Assunto: Pendências apontadas na análise da prestação de contas 
Rio de Janeiro, 20 de maio de 2024 

Em resposta ao Ofício AS/SUBG/CTAT/GPC no 558/2024 encaminho a V. As, para fins de apreciação, o documento pendente referente a prestação de contas da aplicação dos recursos do Termo de Colaboração n° 85/2023, relativa ao período de 01/01/2024 a 31/01/2024. 

Instruem a presente prestação de contas os seguintes documentos: 
a) Relatório de execução financeira; 
b) Memória de Cálculo; 
c) Folha de pagamento; 
d) Certidões negativas; 
e) Anexo IV.1 CODESP - Demonstrativo de movimentação financeira entre contas do mesmo 
contrato; 
f) Anexo V.1 CODESP - Demonstrativo de despesas rateadas por unidade; 
g) Relatório de entrega da prestação de contas OSINFO. 
Respeitosamente, 
Blicia Romas 
Patrícia Moreira Penna Ramos 
Obra do Berço

Assunto: Solicitação de alteração por desbloqueio do Painel OSINFO 

Venho por meio deste solicitar a apreciação de V. As, sobre o pedido de desbloqueio do Painel OSINFO para alteração de parte dos documentos elencados no Oficio AS/SUBG/CTAT/GPC n° 558/2024, referente a prestação de contas da aplicação dos recursos do Termo de Colaboração no 85/2023, relativa ao período de 01/01/2024 a 31/01/2024. 

Instruem a presente solicitação os seguintes documentos: 

a) Relatório de execução financeira; 
b) Anexo IV.1 CODESP - Demonstrativo de movimentação financeira entre contas do mesmo 
contrato; 
c) Anexo V.1 CODESP - Demonstrativo de despesas rateadas por unidade;

Prezados Senhores, 

Viemos por meio desta, de acordo com o que foi informado através do Ofício Circular F/SUBEX no. 005/2020 de 27 de agosto de 2020, solicitar o desbloqueio do painel OSINFO, mais especificamente no modulo de "Contrato de Terceiros” para inserção das documentações faltantes na prestação de contas do mês de abril de 2024, referente ao Termo de Colaboração 249/2021 conforme informado no Ofício AS/SUBG/CTAT/GPC no 780/2024 do dia 04 de junho de 2024, sinalizando as seguintes pendências: 

1. Relatório de execução do objeto; 
2. Declaração de liquidação; 
3. Relatório de entrega da prestação de contas OSINFO; 

Neste ensejo, pedimos o prazo de dez (10) dias úteis para conclusão da inserção documental.

Em resposta ao Ofício AS/SUBG/CTAT/GPC n° 716/2024 encaminho a V. As, para fins de apreciação, o documento pendente referente a prestação de contas da aplicação dos recursos do Termo de Colaboração n° 85/2023, relativa ao período de 01/04/2024 a 30/04/2024. 
Instruem a presente prestação de contas os seguintes documentos: 
a) Folha de pagamento referente ao mês de março/2024; 
b) Anexo IV.1 CODESP 
contrato; 
